import React from 'react';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import AlbumHome from './components/AlbumHome';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <div className="main-title">
          <h1>THE BLOG</h1>
          <h2>2º Aniversario de Margarita & Elí</h2>
        </div>
        <AlbumHome />
      </main>
      <Footer />
    </div>
  );
}

export default App;
